import React, { useState, useEffect } from 'react';
import { getDatabase, ref, query, orderByChild, equalTo, get, remove } from 'firebase/database';
import './Athletics.css';
import MainAcademics from './MainAcademics';

function Athletics() {
  const [eventDate, setEventDate] = useState('');
  const [athleticEventsData, setAthleticEventsData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleEventDateChange = (selectedDate) => {
    setEventDate(selectedDate);
  };

  useEffect(() => {
    if (eventDate) {
      setLoading(true);
      setError(null);

      const db = getDatabase();
      const eventsRef = ref(db, 'athleticEvents');
      const dateQuery = query(eventsRef, orderByChild('eventDate'), equalTo(eventDate));

      get(dateQuery)
        .then((snapshot) => {
          setLoading(false);
          if (snapshot.exists()) {
            const data = snapshot.val();
            const formattedData = Object.keys(data).map((key) => ({ id: key, ...data[key] }));
            setAthleticEventsData(formattedData);
          } else {
            setAthleticEventsData([]);
          }
        })
        .catch((error) => {
          setLoading(false);
          console.error('Error fetching athletic events data:', error);
          setError('Error fetching athletic events data: ' + error.message);
        });
    }
  }, [eventDate]);

  const handleDelete = (id) => {
    const db = getDatabase();
    const eventRef = ref(db, `athleticEvents/${id}`);

    remove(eventRef)
      .then(() => {
        setAthleticEventsData((prevData) => prevData.filter((item) => item.id !== id));
      })
      .catch((error) => {
        console.error('Error deleting athletic event data:', error);
        setError('Error deleting athletic event data: ' + error.message);
      });
  };

  return (
    <div className="athletic-events-container">
      <MainAcademics />
      <h2 className="athletic-events-header">Athletic Events</h2>

      <div className="date-buttons">
        {/* Replace this with your actual date selection logic */}
        {[...Array(12).keys()].map((i) => (
          <div
            key={i + 1}
            className={`date-button ${eventDate === `${i + 1}` ? 'selected' : ''}`}
            onClick={() => handleEventDateChange(`${i + 1}`)}
          >
            <span>Date {i + 1}</span>
          </div>
        ))}
      </div>

      {loading && <p className="loading-message">Loading athletic events data...</p>}
      {error && <p className="error-message">{error}</p>}

      {athleticEventsData.length > 0 ? (
        <table className="athletic-events-table">
          <thead>
            <tr>
              <th>Event Date</th>
              <th>Faculty Coordinator</th>
              <th>PDF</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {athleticEventsData.map((item, index) => (
              <tr key={index}>
                <td>{item.eventDate}</td>
                <td>{item.facultyCo}</td>
                <td>
                  <a href={item.pdfUrl} target="_blank" rel="noopener noreferrer">
                    View PDF
                  </a>
                </td>
                <td>
                  <button onClick={() => handleDelete(item.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : !loading && !error && (
        <p className="no-data-message">No athletic events found for the selected date.</p>
      )}
    </div>
  );
}

export default Athletics;
